import React from 'react';

const Projects = () => {
  const projects = [
    {
      name: 'Portfolio Website',
      icon: 'fas fa-globe',
      description: 'Responsive site using HTML, CSS, JS',
      details: null
    },
    {
      name: 'AQUAFLOW App & Website',
      icon: 'fab fa-android',
      description: 'Water Supply Management System for Panchayath',
      details: 'This system provides a comprehensive framework for managing the time schedule of water supply, facilitating new water connection applications, and addressing complaints related to water supply. The application is a detailed time schedule for informs residents of the water supply schedule for different areas, accessible through both web and mobile platforms. This ensures timely updates and helps residents manage their water usage effectively. Additionally, the system simplifies the process for applying for new water connections by allowing residents to submit and track their applications online, thereby reducing paperwork and speeding up approvals. The PWSMS also provides a platform for lodging complaints related to water supply issues, such as leaks or low pressure, with each complaint assigned a unique tracking number to monitor resolution progress. These features collectively promote transparency, accountability, and improved service delivery within the Panchayath water supply system'
    }
  ];

  return (
    <section id="projects" className="card">
      <h2>Projects</h2>
      <div className="skills-grid">
        {projects.map((project, index) => (
          <div key={index} className="skill-item">
            <i className={project.icon}></i>
            <p>
              <strong>{project.name}</strong><br />
              {project.description}
            </p>
            {project.details && (
              <div className="POP">{project.details}</div>
            )}
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projects;
